import React from 'react';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import {SearchListStory, SearchStory, SearchUser} from '../ScreemFolder/SearchScreen.js'

const Tab = createMaterialTopTabNavigator();

function SearchStackScreen(props) {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Story" component={SearchUser} />
      <Tab.Screen name="User" component={SearchStory} />
      <Tab.Screen name="List Story" component={SearchListStory} />
    </Tab.Navigator>
  );
} export {SearchStackScreen}
